import React from "react";
import { Card, Avatar } from "antd";
const { Meta } = Card;

const IndividualTokenDetail = (props) => {
	return (
		<Card className="individualToken" bordered="true">
			<Meta
				avatar={<Avatar size={60} src={`/${props.token.playerName}.jpg`} />}
				title={props.token.playerName}
				description={
					props.token.latestPrice > 0 ? props.token.latestPrice / 10 ** 18 : "0"
				}
			/>
			<span
				style={{
					position: "absolute",
					right: "10px",
					bottom: "5px",
					fontSize: "10px",
					color: "#55bd6c",
				}}
			>
				5.4%&uarr;
				{props.token.latestPrice > props.token.previousPrice &&
				props.token.previousPrice != 0
					? `${
							(props.token.latestPrice / props.token.previousPrice) * 100 - 100
					  }`
					: "--"}
			</span>
		</Card>
	);
};

export default IndividualTokenDetail;
